import './App.css';
import { Routes, Route, useNavigate } from 'react-router-dom';
import Nav from './Components/Nav';
import Home from './Pages/Home';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />}/>
      </Routes>
    </div>
  );
}

export default App;
